object BigGod {

    fun getTheHead():Head{
        return when(Config.bigGodUseHead){
            0->Head.FengZhiYuan
            1->Head.GanGa
            2->Head.GaoChongPo
            3->Head.SunXiaoChuan
            4->Head.SunZheng
            5->Head.WangHang
            else -> {Head.FengZhiYuan}
        }
    }


    @SubscribeEvent
    fun onRenderPlayerPost(e: RenderLivingEvent.Post<EntityPlayer?>) {
        if(!Config.bigGod){
            return
        }
        if ((e.entity !is EntityPlayer) && !Config.bigGodOtherEntities) {
            return
        }
        if (e.renderer.mainModel !is ModelBiped) return
        var value: Head = getTheHead()
        Minecraft.getMinecraft().getTextureManager().bindTexture(value.texture)
        GlStateManager.disableCull() // 关闭CullFace，使正方形的两面都可见
        if (Config.bigGodThruWalls) {
            GlStateManager.disableDepth() // 关闭深度缓冲，实现ESP的效果
        } else {
            GlStateManager.enableDepth()
        }
        glPushMatrix()
        glTranslated(e.x, e.y, e.z)
        val head = (e.renderer.mainModel as ModelBiped).bipedHeadwear
        glTranslatef(0f, 1.5078125f, 0f)
        if (e.entity is EntityPlayer) glTranslated(0.0, -0.125, 0.0)
        if (e.entity.isSneaking) glTranslated(0.0, -0.18, 0.0)
        glTranslatef(head.offsetX, head.offsetY, head.offsetZ)
        val scaleFactor = -0.0625f
        glTranslatef(
            head.rotationPointX * scaleFactor,
            head.rotationPointY * scaleFactor,
            head.rotationPointZ * scaleFactor
        )
        val size = 0.5
        glRotatef(e.entity.rotationYaw, 0f, -1f, 0f)
        glRotatef(head.rotateAngleX * (180f / Math.PI.toFloat()) - 90f, 1f, 0f, 0f)
        glTranslated(-size / 2.0, 0.0, 0.0)
        val offset = 0.25
        glTranslated(0.0, -offset, 0.0)
        glBegin(GL_QUADS)
        glTexCoord2f(1f, 0f)
        glVertex3d(size, 0.0, 0.0)
        glTexCoord2f(0f, 0f)
        glVertex3d(0.0, 0.0, 0.0)
        glTexCoord2f(0f, -1f)
        glVertex3d(0.0, 0.0, size)
        glTexCoord2f(1f, -1f)
        glVertex3d(size, 0.0, size)
        glEnd()
        glPopMatrix()
        //		GlStateManager.enableTexture2D();
        GlStateManager.enableDepth()
        GlStateManager.enableCull() // 重新开启CullFace，节省性能
    }

    enum class Head(private val img: String?) {
        SunZheng(
            ""
        ),
        WangHang(
            StringBuffer(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).toString()
        ),
        GaoChongPo(
            StringBuffer(
                ""
            ).append(
                ""
            ).append(
                ""
            ).toString()
        ),
        SunXiaoChuan(
            ""
        ),
        FengZhiYuan(
            StringBuffer(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).append(
                ""
            ).toString()
        ),
        GanGa(
            ""
        ),

        ;

        private var resourceLocation: ResourceLocation? = null

        val texture: ResourceLocation
            get() {
                if (resourceLocation != null) {
                    return resourceLocation as ResourceLocation
                }
                try {
                    resourceLocation = ResourceLocation("vapu" + Random().nextInt())
                    Minecraft.getMinecraft().textureManager.loadTexture(
                        resourceLocation, DynamicTexture(
                            ImageIO.read(
                                ByteArrayInputStream(
                                    Base64.getDecoder().decode(
                                        img!!.toByteArray()
                                    )
                                )
                            )
                        )
                    )
                } catch (e: IOException) {
                    throw RuntimeException(e)
                }
                return resourceLocation!!
            }
    }
}